import React, {Component} from 'react';
import {Navbar, Nav, Container} from 'react-bootstrap';
//import nav-opts from  './NavbarComp';

export default class NavbarComponents extends Component {
    render() {
        return (
            <div>
                <Nav className="">
                    <Nav.Link href="#home">Home</Nav.Link>
                </Nav>
            </div>
        )
    }
}

